Парня из Южной Африки высмеяли в Интернете за то, что он сделал девушке предложение в KFC, но в итоге...

• KFC, Audi, Puma решили профинансировать их свадьбу; 
• McDonald's полностью оплатил поездку в Кейптаун на концерт Тони Брэкстона; 
• Банк Standard погасил кредиты молодых на сумму 20.000$; 
• Huawei подарил им свои флагманские телефоны;
• Одна ювелирная компания, предложила молодым забрать золотые кольца с бриллиантами. 
• Uber предоставил молодым людям премиум авто на свадебную церемонию.

